export const nakedSingle = {
  name: "Naked Single",
  check: (cell) => {
    // if this cell has only one suspect...
    if (cell.suspects.size === 1) {
      // ...return that suspect's value.
      return cell.suspects.values().next().value;
    }
    return 0;
  },
};
